// src/components/Navbar.js
import React from 'react';
import styled from 'styled-components';
import { FaReact } from 'react-icons/fa';

const Nav = styled.nav`
  background: #0b59de;
  height: 60px;
  display: flex;
  justify-content: space-between;
  padding: 0 20px;
  align-items: center;
  color: #fff;
`;

const NavLogo = styled.a`
  color: #f2f2f2;
  display: flex;
  align-items: center;
  text-decoration: none;
  font-size: 24px;
`;

const NavMenu = styled.div`
  display: flex;
  gap: 20px;
`;

const NavItem = styled.a`
  color: #fff;
  text-decoration: none;
  &:hover {
    color: #de6e0b;
  }


`;

function Navbar() {
  return (
    <Nav>
      <NavLogo href="#">
        <FaReact style={{ marginRight: '10px' }} />
        CODEV
      </NavLogo>
      <NavMenu>
        <NavItem href="#features">Home</NavItem>
        <NavItem href="#features">Surface Selection</NavItem>
        <NavItem href="#features">Peptide Selection</NavItem>
        <NavItem href="#features">Glossary</NavItem>
        <NavItem href="#features">Features</NavItem>
        <NavItem href="#contact">Contact us</NavItem>
      </NavMenu>
    </Nav>
  );
}

export default Navbar;
